import React, { useState, useEffect } from "react"; // useState와 useEffect 불러오기
import axios from "axios";
import { Link } from "react-router-dom";

function PostListView() {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get('/api/posts')
        .then(res => setPosts(res.data))
        .catch(err => console.log(err))
  }, []);

 // 게시글 작성 버튼 클릭 핸들러
  const handleCreateClick = () => {
    // 게시글 작성 페이지로 이동
  };
  return (
    <div>
      <h1>게시물 목록</h1>
      <ul>
        {posts.map(post => (
          <li key={post.id}>
            <Link to={`/post/${post.id}`}>{post.title}</Link>
          </li>
        ))}
      </ul>
      <button
        className="instagram-button" // 클래스 이름을 설정하여 스타일 적용
        onClick={handleCreateClick}
      >
        <Link to="/post/create">게시글 작성하기</Link>
      </button>
    </div>
  );
}

export default PostListView;
